import './App.css';
import Home from './Table/home';
function App() {
  return (
    <Router>
      <SessionProvider> {/* Envelopper l'application avec le SessionProvider */}
        <Navbar />
        <div>
          <div className="mt-20"></div>
          <Routes>
            <Route path="/wilaya" element={

            <Wilaya />} />
            <Route path="/login" element={<Login />} />
            <Route path="/" element={<Home/>} />
          </Routes>
        </div>
      </SessionProvider>
    </Router>
  );
}

export default App;
